import React from "react";
import './Blog.css';
import Header from '../../components/Header/Header';
import Footer from '../../components/Footer/Footer';
import { Link } from 'react-router-dom';

function Blog(){
    return(
        <>
            <Header />
            <div className="blog-container">
                <a href="/">
                    <img src="https://bfbaby.com.br/up/voltar.png" alt="voltar" className="back" />
                </a>
                <h1 className="title">Blog</h1>
                <div className="content-wrapper">
                    <div className="images-placeholder"></div>
                    <div className="text-content">
                        <h1>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</h1>
                        <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Duis quis libero tempor mauris pulvinar pharetra eu a nunc. Morbi condimentum ex et arcu dignissim, eu elementum sem placerat.</p>
                        <img src="https://bfbaby.com.br/up/leia_mais.png" alt="Leia mais" className="lerMais"/>
                    </div>
                </div>
            </div>
            <Footer />
        </>
    );
}

export default Blog;
